import React from 'react';
import styled from 'styled-components';

export const Sidebar = styled.div`
display: flex;
flex-direction: column;
border-right: 1px solid #e0e0e0;
width: 20%;
height: 100%;
`;

export const Menu = styled.div`
display: flex;
width: 200px;
margin-top: 30px;
`;
